R["oh__@lotlurien"]="{['TS']=1633723499,['eu']={[1]={['N']='Nameless Hero',['O']=18749,['C']=1.029000,},[2]={['N']='Cassanova rest place',['O']=18749,['C']=1.007000,},[3]={['N']='Dunmer Inn Room',['O']=18749,['C']=1.007000,},[4]={['N']='Forbidden Knowledge',['O']=18864,['C']=1.026000,['D']='I am the guardian of the unseen, and knower of the unknown. I have been watching you, mortal.',},[5]={['N']='Hunter business spot',['O']=18897,['C']=1.007000,['D']='The apartment of the skilled hunter and his job deals. Mostly hired by mages guild not for hunting and killing but for tracking and catching daedra alive and this accommodation is directly adapted to it- cages, books about daedra and the comfy spot where deals are made.',},[6]={['N']='A Lil´Murkmire',['O']=18864,['C']=1.049000,['D']='Apartment of former argonian slave Scuttles-This-Way. She was kidnaped from Murkmire into the Vvardenfell by members of house Dres. Later she managed to scuttle away and settle down in Mournhold as mercenary. But she missed Murkmire so much that she decided to create her own. You can find here lots of argonian artefacts, plants, literature and some animals and living plants too. She collected them while working for the merchants and travelers.',},[8]={['N']='The Humble Library',['O']=18749,['C']=1.025000,},[11]={['N']='Saxhleel Roots',['O']=18882,['C']=1.025000,['D']='House of former slave Scuttles-This-Way. She discovered these ayleid ruins taken on her business trip as a mercenary in Shadowfen. It is true that she does not revere the Hist (she was kidnaped from Murkmire as an egg) but she still feels that deep bond with it and with other Argonians. So she decided to know more about her lost culture from the beginning and this place was ideal to study the connection between Ayleid people and the disappearance of Xammers from Tamriel in Merethic Era.',},[13]={['N']='Shrine Of Flowers',['O']=18749,['C']=1.037000,},[14]={['N']='Magic gone wild',['O']=18864,['C']=1.031000,['D']='House of WW bosmer Otrávená Karamelka (Poisoned Toffee). When she was a pup, she stole part of the mysterious magic stone and this is why there are magical flying stones, trees, glowing crystals, and flowers. And this is why she can relax here so much with all of her pack family under the blessing of the lord Hircine himself.',},[15]={['N']='Innedell',['O']=18881,['C']=1.041000,['D']='When the first Wilderking was sent to establish the big city in Vallenwood, few Altmerss accompanied him on his journey and since then Altmers were living in small settlements across the Vallenwood. Here, in Innedell village, altmers managed to change their surrounding to their liking. They live here peacefully alongside dunmers, trading with them and offer magical services as a form of living here, in the lone aldmeri island in the heart of Vallenwood jungle.',},[16]={['N']='Knick Knacks',['O']=18908,['C']=1.030000,['D']='The owner of this humble house had big plans to establish knick-knacks for the needs of every adventurer, scholar, or even an art collector. And of course, to made trades even more convenient, the bank was on reach, right above on the first floor. But the owner forgot that this city already having a bank and merchant conveniently placed few houses away. So now he is trying his best to win new customers and keep his regulars to somehow make a decent living for himself and his two loyal employees.',},[17]={['N']='Fell\\'s Run House',['O']=18888,['C']=1.051000,['D']='The current owner has a good reputation among residents as a merchant, traveler, alchemist and a bit of a weirdo. He stays in seclusion and when he occasionally visits the local inn, it happens that he shares interesting and mysterious stories from his own, as he calls them \"business trips\". Many people think that most of them are made up, but only a handful of his friends, who often come to him for longer visits and some accompany him on his travels, know where the truth is.',},[19]={['N']='Enchanter Emporium',['O']=18749,['C']=1.020000,},[20]={['N']='Sweet Webs',['O']=18881,['C']=1.023000,['D']='Here lives the necro vampire healer Lilabati the Disobedient. With a dark and troubled past in her life, she does not believe in humans anymore. She is living in solitude, sometimes helps desperate people to end some sick deeds, and sometimes she is paid just to kill. She is that scary monster who will take any person with low morals without hesitation. But on the other hand, she can heal as well, but most people are still scared, tho she hurts only those who deserve it (with pay or without).',},[21]={['N']='Pundit sanctuary',['O']=18864,['C']=1.027000,['D']='House of Nénar Kal, house of Indoril. She is a huge fan of Sotha Sil and his creations and hopes, that her hard work and research will open the way into Clockwork city. So her home is not for resting and chilling but for research and science to uncover the mysteries of Tamriel. Few may think that is too dangerous, they say she is playing God. But she has a clear mind and is focused on her target: the magical fusion of life energy and mechanics. ',},[22]={['N']='Laughing Moons House',['O']=18864,['C']=1.026000,['D']='House of maormer/altmer ship captain Azäriah Ancalima and who is looking for her lost brother after the death of their mother. She and her crew temporarily took shelter on land, in this cozy house to investigate the leads and make preparations to continue the search.',},[26]={['N']='Late Stone Age',['O']=18854,['C']=1.031000,['D']=' Take a journey back into the beginning of the modern human - into the home of the first homo- cave man, when the \"sprits\" of the hunt were present when the first people tried to create a safe plate to survive and to assure survival and evolution of the man.',},[29]={['N']='Hot Dumpling Inn',['O']=18881,['C']=1.024000,['D']='A Hot Dumplings Inn welcomes you with good food, tasty mead, a warm beds and moderate prices. Inn owner, Nori Dumpling will ensure that you would want to come back. Her smile and dumplings are legendary in Windhelm after all. What else do you need in the harsh nord winter?',},[31]={['N']='Mighty Cat Pub',['O']=18749,['C']=1.013000,},[32]={['N']='Bhazzul House',['O']=18864,['C']=1.026000,['D']='The house of Gonna Gra-Shemall (gonna crash them all), the orc retired warrior. When she was active she traveled through Tamriel as a mercenary. She has experienced many adventures on her journeys and so she collected many trophies that you can see all over the house. Now she is enjoying her hobbies as growing veggies and caring for the pets. In addition to housework, she still keeps in the shape by helping folks in need or just simply throw knives in the kitchen.',},[81]={['N']='Sober Horker',['O']=18864,['C']=1.051000,['D']='\\rWelcome to the Sorber Horker hero! \\r\\nNeed a shelter? We have free rooms!\\r Is your stomach hungry and mouth dry? We have everything to please your tastes!\\r Homemade mead and fresh ingredient for the cooking and comfortable rooms make our inn the perfect spot to stop before and after every adventure! \\rEvery adventurer is welcomed! Nori Dumpling, the inn owner\\r\\nP.S: Behave yourself, no fights or destroying property! Otherwise our guard will give you quick lesson how to swim in the lake!',},[82]={['N']='The Never-There',['O']=18864,['C']=1.044000,['D']='',},[68]={['N']='Oasis',['O']=18889,['C']=1.026000,['D']='Current shelter of the legendary khajiit, hero, adventurer, seeker of secrets, and tongue of truths. Or not? Well, that depends who you will ask.',},[70]={['N']='Azra\\'ri: Pirate Town',['O']=18881,['C']=1.041000,['D']='Azara´ri - the safe place for the pirate captain Raevina Melle Manantem (from Latin language \"honey\") and her crew. She is an imperial deserter who ran away from the Three Banners\\' War after her parents were killed and took the law into her own hands. Recently, her interest in dragons made her stays longer on the land so she and her crew managed to create a shelter for every person in need to stretch his legs, relax and make some golds hidden from the eyesight of the government.',},[87]={['N']='Into the Oblivion',['O']=18833,['C']=1.026000,['D']='The gates of oblivion are waiting in most unexpected places.',},[34]={['N']='de Odor Morda',['O']=18881,['C']=1.026000,['D']='Calesannah de Odor Morda lost her only family - her trusted senche due to the sickness. She was so sad about her death that when she heard that there is a possibility to bring her back, she does not hesitates. She succeeded and this love and broke heart carved her path into the art necromancy. Due to this, she soon was outcasted from the redguard village she lived and ended up here, where she lives in peace and disturb no one.',},[58]={['N']='Snob Room',['O']=18864,['C']=1.049000,['D']='First \"Flat\" of Sir Meowximus Purrime. After he was kicked out by his parents to finally make living on his own, this was his first place to live, a small, cozy room, whit every property that he was able to put here.. And a little comfort in the form of a private bath (Sir Meowximus has altmer quirk after all).',},[59]={['N']='Hidden Cat Retreat',['O']=18864,['C']=1.051000,['D']='House of Sir Meowximus Purrime, khajiit adopted by altmer and rised up as altmer. Also he is an mercenary... very unskilled one (His first meeting with a bandit almost cost him his tail).  In the backyard, he let live his kin-friend Dar\\'mrissi a legendary adventurer. Meowximus is hoping she will learn him some things, that he will use on his adventures to become legendary as well and make parents proud. But for now, just enjoy this comfort for a while, right?',},[49]={['N']='Witches Hut',['O']=18864,['C']=1.038000,['D']='House of  Miruviel Ehlonfey, protector of The Green, Guardian of The Wyrd, traveler through the  time. She helps the protect and hea and her little Coven Cottage in the swam is an ideal place for that. And safe too, cuz she is still using the old raw magic as one of the Ehlonfey and it may affect surrounding whether she wants or does not want to. And for those she could not help, she arranged a place for eternal peace in the back of the yard.',},[77]={['N']='Solitude Inn',['O']=18749,['C']=1.007000,},[62]={['N']='Mawa University Town',['O']=18881,['C']=1.041000,['D']=' In the shade of Psijic University a little town of Mawa can offer many thing for every promising students of magic what they might need. Residents are quiet and friendly so come to visit. Everyone is welcome:\\r\\nAnd if you are wondering: Am I capable to become a student of the Psijic University?, the entrance exam is simple for those who are gifted: just try to pass through the magic barrier. If you do, you can enter the restricted area of the University itself and fulfill your potential.',},[47]={['N']='Under the Sea',['O']=18864,['C']=1.012000,['D']='When Molag Bal invaded Tamriel, on the land warriors defeated his anchors. But on the see he accidentally summoned a few of his anchors right into the Eltheric ocean and pull a big piece of it into his realm. This place was discovered by Nénar Kal and scholars from mages university. They managed to establish a magic barrier and created an underwater promenade. So take a deep breath and you can explore hidden treasures. For fearless, there is an opportunity to explore the deepest parts of it.',},},['Version']=1762,['Key']='oh__@lotlurien',}"
