R["fx__eu__@strike4__12"]="{['Effects']={[1]={['Groups']=0,['Alpha']=1,['Y']=2177,['Color']=992114,['Id']=1875,['SizeX']=30.456456,['Yaw']=0.387463,['SizeZ']=37,['X']=55466.372027,['EffectType']=8502,['MetaData']={['title']='Tod / Death',['message']='\\nMächtiger, unvermeidlicher, nie endender, schrecklicher, wunderbarer Tod.\\nViele fürchten ihn, manche verehren ihn, und einige sehnen ihn sich herbei.\\nEr ereilt uns alle, früher oder später, alt oder jung, schön oder häßlich, arm oder reich.\\nDer Tod macht keinen unterschied.\\nAlles was lebt wird eines Tages sterben, somit ist der Tod mächtiger als das Leben.\\nWir, die Assassinen, bringen den Tod, jeden tag, und jede Nacht, zu jedem der sterben soll.\\nBegrüßen und preisen wir den mächtigsten aller Götter der uns den Tod bringt, denn nur durch den Tod werden Geschichten zu Epen, werden wir zu Helden, werden wir unsterblich.\\n\\n\\nMein Blut wird kalt, wie die Klinge, die das Schicksal für dich bestimmet.\\nMein Herz wird dunkel, wie das Grab, in das ich dich  leg, am ende des Tags.\\n\\n\\n\\nMighty, inevitable, never ending, terrible, wonderful death.\\nMany fear him, some adore him, and some long for him.\\nIt overtakes us all, sooner or later, old or young, beautiful or ugly, big or small.\\nDeath make no difference.\\nEverything that lives will die one day, so death is much more powerful than life.\\nWe, the assassins, bring death every day, every night, to everyone who is supposed to die.\\nLet us greet and praise the most powerful of all gods who brings us death.\\nBecause only through death\\ndo stories become epics, we become heroes\\nwe become immortal.\\n\\nMy mind gets sharp, on the day, the order came, to stab you away.\\nMy blood grows cold, like the blade, that take your life, as fate command.\\nMy heart grows dark, like the grave, in which i lay you, at the end of the day.',},['Roll']=0,['Z']=31552.673198,['SizeY']=37,['Pitch']=5.044002,['Contrast']=1,},[2]={['Groups']=0,['Y']=2180,['Yaw']=0.387463,['Color']=993310,['SizeX']=113,['Id']=1876,['SizeZ']=134,['Alpha']=1,['EffectType']=72,['X']=55462.491473,['Roll']=0,['Z']=31549.667581,['SizeY']=134,['Pitch']=0.261799,['Contrast']=2.160000,},[3]={['Groups']=0,['Alpha']=1,['Y']=13290,['Color']=20948,['Id']=1877,['SizeX']=188,['Yaw']=0.349066,['SizeZ']=51,['X']=56379.037334,['EffectType']=4407,['MetaData']={['message']='Sanctuary',},['Roll']=0,['Z']=33603.531545,['SizeY']=51,['Pitch']=0,['Contrast']=1.120000,},[4]={['Groups']=0,['Y']=12819,['Yaw']=2.412045,['Color']=399939,['SizeX']=1000,['Id']=1878,['SizeZ']=1000,['Alpha']=1,['EffectType']=871,['X']=54387.714378,['Roll']=0,['Z']=36189.262165,['SizeY']=1000,['Pitch']=0,['Contrast']=1,},[5]={['Groups']=0,['Y']=12810,['Yaw']=2.848377,['Color']=246224,['SizeX']=1000,['Id']=1879,['SizeZ']=1000,['Alpha']=1,['EffectType']=871,['X']=54747.754656,['Roll']=0,['Z']=35602.658954,['SizeY']=1000,['Pitch']=0,['Contrast']=1.200000,},[6]={['Groups']=0,['Y']=12989,['Yaw']=0.308923,['Color']=696473,['SizeX']=512,['Id']=1884,['SizeZ']=512,['Alpha']=1,['EffectType']=428,['X']=56364.842277,['Roll']=0,['Z']=33557.201414,['SizeY']=512,['Pitch']=0,['Contrast']=1,},[7]={['Groups']=0,['Y']=2321,['Yaw']=3.556981,['Color']=141414,['SizeX']=512,['Id']=1885,['SizeZ']=512,['Alpha']=1,['EffectType']=428,['X']=56329.457783,['Roll']=0,['Z']=33465.337563,['SizeY']=512,['Pitch']=0,['Contrast']=1.580000,},[8]={['Groups']=0,['Y']=14114,['Yaw']=4.958480,['Color']=343434,['SizeX']=390,['Id']=1886,['SizeZ']=780,['Alpha']=1,['EffectType']=460,['X']=56102.426588,['Roll']=0,['Z']=34654.441289,['SizeY']=780,['Pitch']=0,['Contrast']=1,},[9]={['Groups']=0,['Alpha']=1,['Y']=12648,['Color']=382299,['Id']=1887,['SizeX']=26.456456,['Yaw']=2.626721,['SizeZ']=30,['X']=54921.648670,['EffectType']=8502,['MetaData']={['title']='Letzte Worte  /  Last Words',['message']='Hier liegt Aella, meine geliebte Frau\\n\\nLiebe beginnt mit einem Lächeln\\nLiebe lebt von Küssen\\nLiebe stirbt mit Tränen\\n\\nMeine Liebe zu dir wird niemals enden.\\nMeine Tränen werden niemals versiegen.\\nEines Tages sind wir wieder vereint.\\nWarte auf mich in der Ewigkeit.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nHere lies Aella, my beloved wife.\\n\\nLove starts with a smile\\nLove lives on kisses\\nLove dies with Tears\\n\\nMy Love for you will never die.\\nMy Tears will never run out.\\n\\nOne Day we\\'ll be together again.\\nWait for me in eternity.',},['Roll']=0,['Z']=35416.403548,['SizeY']=30,['Pitch']=5.152212,['Contrast']=1,},[10]={['Groups']=0,['Y']=12650,['Yaw']=2.675590,['Color']=992422,['SizeX']=120,['Id']=1888,['SizeZ']=120,['Alpha']=1,['EffectType']=72,['X']=54923.132995,['Roll']=0,['Z']=35426.951508,['SizeY']=120,['Pitch']=0.610865,['Contrast']=1.340000,},[11]={['Groups']=0,['Alpha']=1,['Y']=13037,['Color']=240899,['MetaData']={['title']='Assassins Diary',['message']='Tod, Sie ist tod, endgültiger kann kein Gedanke sein. Meine Geliebte, und meine beste Freundin ist nicht mehr da.\\nKein schelmischer blick mehr von ihr, der mich immer so amüsiert hat, kein kleiner Scherz, der mich manchmal erfeut und manchmal geärgert hat. Kein Kuss, keine Berührung mehr von Ihr. Alles was wir zusammen erlebt haben, ist nur noch Erinnerung, die verblassen wird.\\nWas soll ich nur tun, wie soll das Gefühl jemals enden?\\nDer Tag an dem Ich das Schwarze Sakrament an Ihr auführen musste, war der schlimmste meines Lebens.\\nWas hätte ich tun sollen, mit ihr fliehen und den Rest unseres Lebens verstecken? Ein anderer Assassine hätte den Auftrag bekommen uns beide zu töten.\\nIch weiss nicht, wer das Schwarze Sakrament gefordert hat, es ist auch nicht wichtig.\\nIch habe es schnell und schmerzlos getan, sie hat nicht gelitten. Mein Schmerz hingegen wird mich bis zu meinem Tod begleiten.\\n\\n\\n\\nDead, she is dead, no thought can be more final. My beloved and my best friend is no longer there. No mischivous look from her, which always amused me so much, no more little joke, that somtimes pleased and sometimes annoyed me. No Kiss an no touch from her. Everything we have  together experienced, is just a memory that will fade.\\nWhat should i do, will this feeling ever end?\\n\\nThe day i had to perform the Black Sacrament on her, was the worst day of my life.\\n\\nWhat should I have done, run away with her and hide for the rest of our lives? Another Assassin would have been assigned to kill both of us.\\n\\nI don\\'t  know who called for the Black Sacrament, it doesn\\'t matter either.\\nI did it quick and painlessly, she did not suffer, but my pain will stay with me, until my death.',},['SizeX']=32.456456,['SizeY']=52,['SizeZ']=52,['Roll']=0,['EffectType']=8502,['Contrast']=1,['X']=57616.482245,['Z']=33634.728632,['Id']=1889,['Pitch']=4.691445,['Yaw']=0.713840,},[12]={['Groups']=0,['Y']=13040,['Alpha']=1,['Color']=351199,['SizeX']=120,['SizeY']=100,['SizeZ']=100,['Contrast']=1,['EffectType']=72,['Roll']=0,['X']=57620.446567,['Z']=33637.676084,['Id']=1890,['Pitch']=0,['Yaw']=0.797615,},},['Version']=1762,['TS']=1633531133,}"
