R["oh__@seecodenotgames"]="{['eu']={[64]={['N']='LakemireWaterGardens',['O']=18813,['C']=1.021000,['D']='Relax in our tranquil water gardens or explore the hanging gardens of Lakemire. Once you have worked up an appetite, you can visit our seafood restaurant beneath the Xanmeer, where you can eat the catch of the day, while watching the fishes swim behind the magical picture windows.',},[69]={['N']='DragonguardPenthouse',['O']=18813,['C']=1.021000,['D']='After extensive renovations, the Dragonguard Penthouse has reopened to its members. Now fitted with a top floor gym, members of the reformed ancient order can keep healthy and relax while they are taking a break from slaying the dragons destroying Elsweyr. Hidden inside the walls of Jode’s Embrace, across three additional spacious floors, the Dragonguard Penthouse is open to members and visitors.',},[70]={['N']='Dwemer Party Tower',['O']=18813,['C']=1.027000,['D']='This Dwemer Tower is actually an ancient flying machine, which can fly anywhere in Tamriel, but expect a long slow journey; more time to enjoy the amazing views and relax with friends. Food and drink will be served throughout. Currently it is docked above the forests of Southern Elsweyr, near a place known locally as Lion’s Cradle.',},[71]={['N']='Treefern House',['O']=18813,['C']=1.021000,['D']='When a giant treefern was discovered growing in Tenmar Forest, a wealthy Khajiiti merchant from Rimmen decided it was the perfect place to build a treehouse to relax when not peddling his wares.',},[72]={['N']='Spirit-Tree Library',['O']=18813,['C']=1.025000,['D']='A band of five scholars and explorers discovered an ancient forest, buried deep inside an even older Daedric cultist’s lair. After many years of hard work, they have finished their new library, built around the spirit tree at the centre of the dark wood.',},[9]={['N']='Alinor Garden Party',['O']=18814,['C']=1.021000,['D']='The annual Alinor garden party has been relocated this year, due to ongoing turmoil on the island of Summerset, to the neighbouring island of Auridon. The Mathiisen country estate has opened its door to all men and mer. Dress code is formal.',},[75]={['N']='Icy Falls Inn',['O']=18813,['C']=1.024000,['D']='Situated on a pristine lake beneath an icy waterfall, these two Nord shacks are both warm and frigid in equal measures.',},[76]={['N']='Golden Beach Palace',['O']=18813,['C']=1.035000,['D']='Relax by the pool in this Redguard beach resort, inspired by Dwarven architecture. Includes two bedrooms, an open kitchen diner and a large sun terrace on the roof.',},[79]={['N']='Lava Submarine Base',['O']=18813,['C']=1.023000,['D']='After moving into an abandoned castle, deep into Blackreach, a member of house Ravenwatch discovers the secrets of this forgotten abode go even deeper. Beneath the ancient stone structure is a hidden laboratory, accessible only via an underground lava tunnel. The previous owners were in such a hurry to evacuate that they left their prized lava submarine in the docks beneath the keep, and a lab full of alchemical experiments and reagents.',},[80]={['N']='Blue-ice Palace',['O']=18813,['C']=1.017000,['D']='After being banned from Solitude, an exiled Nord noble set about recreating the Blue Palace on a permanently frozen lake east of Morthal for his large family.',},[81]={['N']='Big Toy House',['O']=18813,['C']=1.022000,['D']='The eccentric owner of this Hjaalmarch homestead has decided to build not one, but two, life-sized doll��s houses to celebrates his daughter’s marriage. Afterwards they can celebrate in the inn beneath the stairs.',},[82]={['N']='Lost Dwarven Kingdom',['O']=18813,['C']=1.020000,['D']='Centuries ago, this vast palace housed the remnants of the last Dwemer Kingdom. Now this building has been found floating in a mage’s pocket realm, preserved for all eternity. New owners have converted this once regal palace into a place of study, in the vast emptiness of this solitary realm.',},[83]={['N']='Markarth Bath House',['O']=18813,['C']=1.014000,['D']='After a long day of adventuring, come visit our newly opened hot spring baths and cleanse your weary body. Located in a Dwarven mansion, we have a warm relaxing spa, high pressure shower and space to eat and dine. We also allow our guests to stay the night. There is also an arts and craft centre for those who want to relax the mind, as well as the body. We have just extended the manor and built a brand new VIP bath house adjacent to the main building, equipped with facilities for your every need',},[86]={['N']='Varlaisvea College',['O']=18813,['C']=1.020000,['D']='Found deep in an Ayleid well, Varlaisvea College has reopened to a new generation of students. This academic centre is equipped with a massive library, dining areas, and a brand new study hall and swimming pool.',},[23]={['N']='A Taste of Alinor',['O']=18813,['C']=1.021000,['D']='A small piece of Alinor situated beside a Rawl’kha creek.',},[88]={['N']='Helene\\'s Boutique',['O']=18855,['C']=1.026000,['D']='The world-renowned dress maker Helene Dassovia has just opened a new boutique in town. Whether it be an evening gown for a garden party, a beautiful wedding dress, or just a frock to impress your friends, Helene’s Boutique has a dress for every occasion. Just don’t expect much change if you buy one of her famous garments.',},[25]={['N']='Mad Scientists House',['O']=18813,['C']=1.027000,['D']='This mad scientist spends most of his days locked away in his workshop, trying to invent a means of traveling through time. So far his experiments suggest he on close to a breakthrough on his latest invention, the De-lore-ean.',},[91]={['N']='Cascadia Wine N Dine',['O']=18904,['C']=1.021000,['D']='You are invited to our winery, where you can drink and dine with style. Our halls are laden with fresh prepared food and our pantries are always well stocked. Our grapes are harvested on site, and stored in our extensive wine and beer cellars beneath the manor. If you have a large party, you may prefer the privacy of the moated guest house and divine chapel across the courtyard.',},[28]={['N']='Nord Lodge',['O']=18813,['C']=1.051000,['D']='A modest Nord lodge for a humble adventurer.',},[29]={['N']='Three Pillows War',['O']=18813,['C']=1.022000,['D']='Three friends are locked in their Windhelm retreat, but still want to have their camping trip, so they set up camp indoors. After a game of Monopoly: Tamriel edition results in the table being flipped, the three friends recreate the three banners war from the comfort of their pillow forts.',},[38]={['N']='Vampire Academy',['O']=18813,['C']=1.020000,['D']='After being rebuilt for a third time, the Vampire Academy is having an open day for next year’s intake of students. Entry requirements are tight, and only a few students are selected each season. If you’re not a vampire (yet), you can still join us for nibbles; you may even decide to stay (for eternity) in our grand castle just outside Daggerfall. Ignore the rumours of a secret lair beneath the city, all of our vampires are fully restrained and don’t practice any dark magic beneath your streets.',},[40]={['N']='Topal Fishing Resort',['O']=18813,['C']=1.018000,['D']='Rent your own private island and invite your friends over to this tropical paradise. Relax in the holiday village or spend your time fishing in one of our hidden lakes, all off the coast of the Topal Bay.',},[41]={['N']='Cave of BBQ N Ribs',['O']=18813,['C']=1.024000,['D']='A secret dome, built inside a dank and secluded cavern, hosts the best BBQ and ribs restaurant in Hammerfell. Just don’t steal my sweetrolls.',},[43]={['N']='Walled KitchenGarden',['O']=18877,['C']=1.021000,['D']='Our kitchen gardens are open to all visitors. Our produce is grown fresh by local farmers and available for purchase. You can taste our delicious cooked food in our family restaurant and bar. We also have a variety of fresh cut flowers for sale.',},[46]={['N']='Imperial BridalSuite',['O']=18814,['C']=1.021000,['D']='Book your wedding at the most glamourous venue in the Gold Cost at this Imperial merchant’s manor just outside Kvatch. This Stately home has just undergone extensive renovations and redecorations throughout.',},[47]={['N']='Mushroom Manor',['O']=18813,['C']=1.021000,['D']='When an Hlaalu scholar was looking for seclusion to focus on his research, he didn’t anticipate his mushroom manor being pulled into the Daedric realm of Coldharbour. His retreat was built from the canopies of seven giant Vvardenfell mushrooms, with enough space inside for an extensive library, dining hall, two bedrooms and an open living room, as well as room for outdoor dining.',},[49]={['N']='Witch Tower Inn',['O']=18813,['C']=1.024000,['D']='A creaky witch’s tower was found abandoned in the Hag Fen. When a group of explorers squabbled between themselves with what to do, they settled on the one logical conclusion. Turn it into an inn.',},[55]={['N']='City on the Moon',['O']=18813,['C']=1.032000,['D']='This Moonbase is more than just an excellent research space, it is also the gateway to a lunar city. Permanent dwellings house the city’s residents and it even has an inn under the stars.',},[15]={['N']='Treeship House',['O']=18813,['C']=1.015000,['D']='A Bosmer village awoke one morning to find an imperial ship in the treetops. So what did they do with it? They turned it into a new home. How did it get there? No one knows, but it does make an alternative treehouse.',},[6]={['N']='Linking With Portals',['O']=18813,['C']=1.006000,['D']='I have created a portal machine with programmable portals. The user can choose any destination from a list and travel to that house. You can set the destination by illuminating the salt lamp corresponding to the house you would like to visit (any colour). You can see the list of houses in the lorebook. After setting the destination, you can then walk through the portal and it will transport you to the chosen house.',},[59]={['N']='Castleton Manor',['O']=18813,['C']=1.026000,['D']='Sonja is due to be married to the eldest son of a rival noble house. Her father Lord Castleton has commissioned the famous dress maker Helene Dassovia to create a wedding dress for the big day, but Sonja is more interested in the judicial duel in the manor courtyard.',},[11]={['N']='Who Lives in a Shoe',['O']=18813,['C']=1.020000,['D']='When the citizens of Stormhold found a daedric cult on the outskirts of their city, they found a reach witch and her adult children had died suddenly, possibly from poisoning. Now the new owner is a friendly witch who lives alone in this oversized shoe.',},[61]={['N']='Hircine\\'s Hunt Club',['O']=18813,['C']=1.043000,['D']='Come join our exclusive club in the hunting grounds. To find us us you must first prove yourself worthy in Hircine’s eyes, and gain the hunt master��s gift. We have game and mead for all our brothers and sisters to savour the endless feast. Just don’t be screamish if the meat comes raw and bloody.',},[62]={['N']='Artaeum Theatre',['O']=18813,['C']=1.040000,['D']='Disconnected from Tamriel and the rest of society, you’d think that this opera house on a hidden island wouldn’t get many visitors, yet they’re sold-out every weekend. Includes its own divine chapel by the mysterious Artaeum waters for those who would rather relax with a book.',},[73]={['N']='Luckycat Summerhouse',['O']=18865,['C']=1.021000,['D']='Cool off from the hot Elsweyr sun at our Senchal Luckycat’s Summerhouse. This villa has a large reception room, kitchen, bathroom and sheltered patio. Upstairs there is a quiet meeting room and large bedroom overlooking the sea.',},},['Version']=1762,['TS']=1633377874,['Key']='oh__@seecodenotgames',}"
