R["oh__@hashii"]="{['TS']=1631788966,['Version']=1762,['na']={[64]={['N']='Lakemire University',['O']=18840,['C']=1.026000,['D']='Altmer scholars and mages visited Murkmire to study the local nature, alchemy, and enchanting. To establish relations with the locals, they established a university to cultivate the knowledge. Lakemire University blends altmer and argonian culture to provide a safe haven for higher knowledge in the mystic arts. ',},[47]={['N']='The Sweetbreads',['O']=18827,['C']=1.023000,['D']='Just an innocent store with delicious sweet breads and fruits. they even have cake! \\n\\nNothing to see behind the storage room. ',},[71]={['N']='Temple of Alkosh',['O']=18821,['C']=1.500000,['D']='Temple of Alkosh is a grand complex dedicated to the worship of the Aedra and Daedra. Worshippers, scholars, historians, kings, queens, and just about anyone is welcome to this neutral Khajiiti territory to explore the higher dimensions of life. ',},[70]={['N']='Lunar Research Lab',['O']=18885,['C']=1.026000,['D']=' \"Our lady, the moon and the stars, our creator, and the one who shaped us into being Khajiit. We must show respect to Lady Azurah and study Jone and Jode! We must preserve Khajiiti culture and transcend the limitations of this physical plane\"\\r\\n \\r\\n Welcome to Rimmen\\'s Lunar Research Lab. Here, scholars and philosophers and researchers have everything they need - to explore, to meditate, to transcend, and even to relax. New initiates are welcome to join today!',},[63]={['N']='Moon & Stars Cottage',['O']=18886,['C']=1.050000,['D']='Merry New Life! Welcome friends, let us feast and warm by the fire during this cold winter. After a hard day\\'s work, the Moon and Stars cottage offers the a place to relax, eat, cook, drink, and play games. Also, it wouldn\\'t be New Life without presents to open! Not only that, there is a special guest downstairs to bless you for the upcoming the new year!',},},['Key']='oh__@hashii',}"
