R["fx__eu__@strike4__6"]="{['Version']=1757,['TS']=1629301758,['Effects']={[1]={['MetaData']={['title']='Diary of Abaani Sha\\'rahkar',['message']='It\\'s done, Mah\\'ravi is finally dead.\\nAfter almost three years of preparation, it was successful.\\nMah\\'ravi took her own life as planned. The house and estate are mine now. Nobody will be suspicious.\\nAll the false friendship and love are over now.\\n\\nAgain and again, I appeared to her as the \"ghost\" of her sister. I came and went through the hidden portal, until it finally worked. The poison that I gave her in small doses every now and then, also helped.\\n\\nAs soon as everything is settled, I\\'ll have the house and the decaying garden cleared, a large hotel will be build on the beautiful site, which I will then sell for a huge profit.\\n\\nThen I can sit down and have a glass of sweet skooma on Mah\\'ravi and her beloved husband Da\\'har.\\nDa\\'har, with whom I planned everything, but who then got to greedy.\\nHe has a little \"accident\", hehe.\\n\\nThe gold this little bitch hid from me in the garden, will help me a lot in living a life of luxury.\\n\\nFinally, I would like to thank Molag Bal, the god of schemes, who inspired me.\\n\\n\\nWhen I\\'ve buried her body in her beloved garden, my new life will begin\\n\\n',},['Y']=20185,['X']=25770,['Id']=1688,['Roll']=0,['SizeX']=27.456456,['SizeY']=31,['Pitch']=5.138249,['Z']=27119,['Groups']=0,['Alpha']=1,['Color']=102439,['Yaw']=2.663372,['SizeZ']=31,['EffectType']=8502,['Contrast']=1,},[2]={['Id']=1843,['Contrast']=1,['X']=25657.235556,['Roll']=0,['SizeX']=600,['SizeY']=600,['Pitch']=0,['Z']=26337.182194,['Groups']=0,['Alpha']=0.820000,['Color']=663926,['Yaw']=0.392699,['SizeZ']=600,['EffectType']=4537,['Y']=20280,},[3]={['Id']=1847,['Contrast']=1,['X']=25767.319700,['Roll']=0,['SizeX']=140,['SizeY']=140,['Pitch']=0.401426,['Z']=27114.638707,['Groups']=0,['Alpha']=1,['Color']=483999,['Yaw']=2.432989,['SizeZ']=140,['EffectType']=72,['Y']=20186,},[4]={['