R["fx__eu__@strike4__37"]="{['Version']=1757,['TS']=1629301143,['Effects']={[1]={['Roll']=0,['Y']=22264,['X']=31520.185328,['Contrast']=1,['SizeZ']=35,['Id']=1837,['Color']=389946,['Groups']=0,['Z']=19364.236884,['SizeX']=29.456456,['Pitch']=4.799655,['SizeY']=35,['Alpha']=1,['Yaw']=3.595378,['MetaData']={['title']='For Abaani',['message']='Dear Abaani,\\nI want to say goodbye to you. You are the only one I think of, before I leave my house and garden. My garden, my wonderful garden. I have tried so hard to get something beautiful out of this barren land. The work on the garden has always made me happy. After Dar\\'hars death, it was the work on the garden that did not drive me crazy.\\n\\nBut now it\\'s time to go. My body is tired from all the toil, and my mind is darkening more and more.\\nDar\\'sha, my late sister, appears to me more often, and says that I should come to her. She passed away three years ago..\\nI\\'ve brewed myself a potion made from deadly nightshade and moonsugar, that will take me slowly and painlessly into the next world.\\n\\nI want to bequeath the House to you, my friend\\nPlease take care of the garden a little, it was my and Dar\\'hars life\\'s work.\\nIn the back of the house you can find some gold to help you with this. The pottery, which I\\'ve made some money doing, hasn\\'t brought in that much lately. My hands are no longer skillful enough.\\n\\nGoodbye, don\\'t be sad, one day we\\'ll meet again, you\\'ve always been my best friend.\\n\\nMah\\'ravi\\n\\n',},['EffectType']=8501,},[2]={['Y']=22269,['X']=31518.570606,['Alpha']=0.780000,['SizeZ']=180,['Id']=1838,['Color']=20666,['Groups']=0,['Z']=19351.690829,['SizeX']=140,['Pitch']=0,['SizeY']=180,['Contrast']=2.280000,['Roll']=0,['Yaw']=3.092723,['EffectType']=72,},[3]={['Roll']=0,['Y']=22022,['X']=38044.707470,['Contrast']=3.280000,['SizeZ']=30,['Id']=1842,['Color']=313434,['Groups']=0,['Z']=18445.329523,['SizeX']=80,['Pitch']=0,['SizeY']=30,['Alpha']=0.750000,['Yaw']=4.574508,['Me