orunn asked me to give his effeminate son an apprenticeship.\\nHe came up with the idea to fake kidnapping. Who contradicts a king?\\nI\\'ll keep his offspring, who is by the way an arrogant Skeever, here for a few days, and then I\\'ll send him back to his father.\\n\\nThe smuggler worry me a little, they paid by the king, but is it enough gold for them?\\nThey deceive the poor travelers with the \"Healing Spring\".\\nThe water is normal brook water, and heals only the smugglers purse.\\nThe smuggler live over in the old temple.\\nTonight they going on a raid, then there will be some rest here',},['EffectType']=8502,['Roll']=0,['Groups']=0,['Yaw']=2.183407,['Alpha']=1,['X']=19845,['SizeZ']=37,['Z']=58451,['SizeX']=31.456456,['SizeY']=37,['Pitch']=4.712564,['Id']=1658,['Y']=19285,['Contrast']=1.560000,['Color']=307928,},[10]={['MetaData']={['title']='Diary Prince Inskar',['message']='They have been holding me prisoner for days. What do they think of treating me like that? Lock me in this cell. I\\'m a prince and not a thief!\\nThe ransom that they are demanding for me, has not yet arrived. Add to that the ransom, 10000 gold, a ridiculous sum.\\nMy father, the Skals king, must have brought the gold on the way.\\nDeras, the Dunmer, said I would be let go as possible the gold has arrived. I don\\'t trust him, he looks sly, and i have the impression, that there is more than he tells me',},['EffectType']=8502,['Roll']=0,['Groups']=0,['Yaw']=0.675442,['Alpha']=1,['X']=17728,['SizeZ']=35,['Z']=61377,['SizeX']=31.456456,['SizeY']=35,['Pitch']=4.625123,['Id']=1659,['Y']=19584,['Contrast']=2.120000,['Color']=217442,},[11]={['MetaData']={['title']='Diary of Pirharri',['message']='\\n.... they still haven\\'t discoverd Pirharri. The Guard walks past, without knowing that these one is there.\\nThe warning at the entrance is a joke, there is no Legacy Decimus, only smugglers and thieves who go about their buisness here undisturbed.\\nThe smugglers will look stupid, if Pirharri steal from them. A thief is stealing from other thiefes, these one have to lough.\\nI think they have a prisoner, maybe he\\'s rich and will pay, if these one free him.\\n\\nThese one heard, they go on a raid tonight. They go out, Pirharri go in.\\nMay the gods have mercy on these one...\\n\\n',},['EffectType']=8501,['Roll']=0,['Groups']=0,['Yaw']=2.008874,['Alpha']=1,['X']=15922,['SizeZ']=30,['Z']=67289,['SizeX']=26.456456,['SizeY']=30,['Pitch']=4.701917,['Id']=1661,['Y']=25148,['Contrast']=1.900000,['Color']=208099,},[12]={['MetaData']={['message']='Restricted Area',},['EffectType']=4405,['Roll']=0,['Groups']=0,['Yaw']=5.731661,['Alpha']=1,['X']=19438,['SizeZ']=24,['Z']=61059,['SizeX']=131,['SizeY']=24,['Pitch']=0,['Id']=1663,['Y']=24909,['Contrast']=1.540000,['Color']=899099,},[13]={['MetaData']={['message']='KEEP OUT!',},['EffectType']=4405,['Roll']=0,['Groups']=0,['Yaw']=5.731661,['Alpha']=1,['X']=19444,['SizeZ']=20,['Z']=61066,['SizeX']=100,['SizeY']=20,['Pitch']=0,['Id']=1664,['Y']=24866,['Contrast']=1.680000,['Color']=899099,},[14]={['Y']=23915,['X']=26937,['Groups']=0,['Alpha']=0.500000,['EffectType']=72,['Yaw']=2.359685,['SizeZ']=200,['Z']=66099,['SizeX']=160,['SizeY']=200,['Pitch']=0,['Id']=1667,['Contrast']=3.680000,['Roll']=0,['Color']=271799,},[15]={['Y']=25150,['X']=15916,['Groups']=0,['Alpha']=1,['EffectType']=72,['Yaw']=4.935791,['SizeZ']=80,['Z']=67291,['SizeX']=100,['SizeY']=80,['Pitch']=0,['Id']=1668,['Contrast']=1.780000,['Roll']=0,['Color']=19984,},[16]={['Y']=19283,['X']=19845,['Groups']=0,['Alpha']=1,['EffectType']=72,['Yaw']=2.370157,['SizeZ']=120,['Z']=58453,['SizeX']=100,['SizeY']=120,['Pitch']=0,['Id']=1669,['Contrast']=1,['Roll']=0,['Color']=149908,},[17]={['Y']=19582,['X']=17733,['Groups']=0,['Alpha']=1,['EffectType']=72,['Yaw']=0.986111,['SizeZ']=140,['Z']=61384,['SizeX']=117,['SizeY']=140,['Pitch']=0,['Id']=1670,['Contrast']=1,['Roll']=0,['Color']=169924,},[18]={['Y']=24741,['X']=17814,['Groups']=0,['Alpha']=0.750000,['EffectType']=531,['Yaw']=0.958186,['SizeZ']=37,['Z']=63504,['SizeX']=35,['SizeY']=37,['Pitch']=0.010472,['Id']=1673,['Contrast']=2.660000,['Roll']=0,['Color']=633716,},[19]={['MetaData']={['title']='The Healing Spring',['message']='The waters of the healing spring are blessed by the gods.\\nA cup, drunk fresh from the spring, heals diseases of the body and the soul.\\nFor a few pieces of gold, the water can also bring happiness.\\nDrink until you burst with happiness (if you have enough gold)\\n\\nIf you don\\'t have gold, move away fom the spring, and make room for\\nthose who have gold.\\n',},['EffectType']=8502,['Roll']=0,['Groups']=0,['Yaw']=1.031490,['Alpha']=1,['X']=18131,['SizeZ']=39,['Z']=63490,['SizeX']=32.456456,['SizeY']=39,['Pitch']=4.799655,['Id']=1674,['Y']=24681,['Contrast']=2.340000,['Color']=34900,},[20]={['Y']=24677,['X']=18126,['Groups']=0,['Alpha']=1,['EffectType']=72,['Yaw']=1.031490,['SizeZ']=120,['Z']=63492,['SizeX']=113,['SizeY']=120,['Pitch']=0,['Id']=1675,['Contrast']=1.500000,['Roll']=0,['Color']=58199,},},['TS']=1607272208,['Version']='15.9.7',},[8]={['World']='eu',['HouseId']=31,['Effects']={[1]={['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['EffectType']=5135,['Roll']=0,['Groups']=0,['Yaw']=4.541347,['Alpha']=0.940000,['X']=28071,['SizeZ']=354,['Z']=24011,['SizeX']=571,['SizeY']=354,['Pitch']=4.712564,['Id']=1713,['Y']=20027,['Contrast']=1.060000,['Color']=41115,},[2]={['Y']=20318,['X']=27670,['Groups']=0,['Alpha']=1,['EffectType']=954,['Yaw']=0.321141,['SizeZ']=600,['Z']=23434,['SizeX']=50,['SizeY']=600,['Pitch']=0,['Id']=1715,['Contrast']=1.750000,['Roll']=0,['Color']=378599,},[3]={['Y']=20318,['X']=27507,['Groups']=0,['Alpha']=1,['EffectType']=954,['Yaw']=0.321141,['SizeZ']=600,['Z']=24358,['SizeX']=50,['SizeY']=600,['Pitch']=0,['Id']=1716,['Contrast']=1.750000,['Roll']=0,['Color']=378599,},[4]={['Y']=20358,['X']=27027,['Groups']=0,['Alpha']=1,['EffectType']=470,['Yaw']=1.411971,['SizeZ']=140,['Z']=23932,['SizeX']=140,['SizeY']=140,['Pitch']=1.570971,['Id']=1717,['Contrast']=0.960000,['Roll']=0,['Color']=346999,},[5]={['Y']=20358,['X']=27067,['Groups']=0,['Alpha']=1,['EffectType']=470,['Yaw']=1.436406,['SizeZ']=140,['Z']=23657,['SizeX']=140,['SizeY']=140,['Pitch']=1.570971,['Id']=1718,['Contrast']=0.620000,['Roll']=0,['Color']=528699,},},['TS']=1608986003,['Version']='16.0.9',},[9]={['World']='eu',['HouseId']=5,['Effects']={[1]={['MetaData']={['title']='Augen im Dunkel / Eyes in the dark ',['message']='Blicke verfolgen mich, sie sind ?berall um mich herum. Wer beobachtet mich? wer ist da im dunkel?. Sie starren mich an, starren mit unbeweglichen Augen, was habe ich getan? warum verfolgen sie mich?.\\nIch h?re Schritte, zuerst leise, fast unh?rbar, unterbrochen durch stille, dann lauter, hinter mir, n?herkommend. Wenn ich mich umdrehe ist da niemand oder etwas zu sehen. Das Dunkel verschlingt alles, und zeigt neues, unheimliches. Schatten am Boden, Schatten an den W?nden, Schatten, die sich ver?ndern. \\nDas Dunkel greift nach mir, die Schatten werden drohender. Meine Blicke werden ruhelos, die Blicke um mich herum auch. Ich sehe ein Gestalt im Dunkel, oder ist das nur ein Schatten?.\\nDie Nacht scheint endlos, meine Gedanken schreien in die Schw?rze um mich herum, und in mich hinein. Ich falle, falle immer tiefer, in meine Gedanken, in das Dunkel.\\nBin ich allein? \\n\\nEyes in the dark\\n\\nGazes haunt me, they\\'re all around . Who is watching me?, who is there in the dark? They stare at me, stare with immobile eyes. What have I done? Why are they chasing me?\\nI hear footsteps, at first soft, interrupted by silence, then louder, behind me, approaching. When I turn around, there is nobody or something to be seen.\\nThe dark devours everything, but also show something new. Shadows on the floor, shadows on the walls, shadows that change.\\nThe darkness reaches for me, the shadows become more threatening. My gaze becomes more restless, as does the gazes around me.\\nI see a figure in the dark, or is it just a shadow? The night seems endless, my thoughts scream into the darkness around me, and inside me.\\nI\\'m falling, falling deeper and deeper into my thoughts, into the dark.\\nAm I alone?',},['EffectType']=8502,['Roll']=0,['Groups']=0,['Yaw']=3.117158,['Alpha']=1,['X']=25517,['SizeZ']=39,['Z']=26260,['SizeX']=33.456456,['SizeY']=39,['Pitch']=5.148721,['Id']=1684,['Y']=20248,['Contrast']=1,['Color']=140699,},[2]={['Y']=20293,['X']=25864,['Groups']=0,['Alpha']=1,['EffectType']=504,['Yaw']=0.001745,['SizeZ']=472,['Z']=25698,['SizeX']=340,['SizeY']=472,['Pitch']=6.265732,['Id']=1705,['Contrast']=0.440000,['Roll']=0,['Color']=595959,},[3]={['Y']=20069,['X']=25822,['Groups']=0,['Alpha']=1,['EffectType']=880,['Yaw']=6.195919,['SizeZ']=500,['Z']=25749,['SizeX']=500,['SizeY']=500,['Pitch']=4.691445,['Id']=1725,['Contrast']=0.010000,['Roll']=0,['Color']=131313,},[4]={['Y']=20664,['X']=25555,['Groups']=0,['Alpha']=0.750000,['EffectType']=865,['Yaw']=2.979277,['SizeZ']=630,['Z']=26167,['SizeX']=1320,['SizeY']=630,['Pitch']=1.570971,['Id']=1726,['Contrast']=0.640000,['Roll']=0,['Color']=996959,},},['TS']=1609158170,['Version']='16.0.9',},},['Key']='fx__@strike4',}"
