R["fx__eu__@strike4__38"]="{['Effects']={[1]={['Yaw']=4.537856,['Y']=5782,['X']=93412,['EffectType']=87,['Groups']=0,['Alpha']=0.740000,['Id']=1612,['Z']=59780,['Roll']=0,['SizeZ']=620,['Contrast']=1,['Color']=494040,['SizeX']=700,['Pitch']=2.879793,['SizeY']=620,},[2]={['Yaw']=4.537856,['Y']=5722,['X']=92680,['EffectType']=87,['Groups']=0,['Alpha']=0.740000,['Id']=1613,['Z']=59971,['Roll']=0,['SizeZ']=840,['Contrast']=2.540000,['Color']=272222,['SizeX']=740,['Pitch']=2.879793,['SizeY']=840,},[3]={['Yaw']=5.707227,['Y']=5089,['X']=93140,['EffectType']=499,['Groups']=0,['Alpha']=0.750000,['Id']=1614,['Z']=60309,['Roll']=0,['SizeZ']=1020,['Contrast']=1,['Color']=494949,['SizeX']=1000,['Pitch']=0,['SizeY']=1020,},[4]={['Yaw']=5.270894,['Y']=4889,['X']=96721,['EffectType']=951,['Groups']=0,['Alpha']=0.810000,['Id']=1615,['Z']=60050,['Roll']=0,['SizeZ']=340,['Contrast']=2,['Color']=998964,['SizeX']=340,['Pitch']=0,['SizeY']=340,},[5]={['Yaw']=4.660029,['Y']=4897,['X']=96682,['EffectType']=970,['Groups']=0,['Alpha']=1,['Id']=1616,['Z']=60055,['Roll']=0,['SizeZ']=480,['Contrast']=1,['Color']=992521,['SizeX']=500,['Pitch']=0,['SizeY']=480,},[6]={['Yaw']=5.707227,['Y']=5087,['X']=92971,['EffectType']=525,['Groups']=0,['Alpha']=1,['Id']=1617,['Z']=60373,['Roll']=0,['SizeZ']=1060,['Contrast']=1,['Color']=991109,['SizeX']=1060,['Pitch']=0,['SizeY']=1060,},[7]={['Yaw']=2.565634,['Y']=13601,['X']=91320,['EffectType']=951,['Groups']=0,['Alpha']=1,['Id']=1620,['Z']=58789,['Roll']=0,['SizeZ']=300,['Contrast']=2,['Color']=998964,['SizeX']=300,['Pitch']=0,['SizeY']=300,},[8]={['Yaw']=1.396263,['Y']=5082,['X']=92923,['EffectType']=87,['Groups']=0,['Alpha']=0.740000,['Id']=1621,['Z']=60438,['Roll']=0,['SizeZ']=620,['Contrast']=1,['Color']=272222,['SizeX']=700,['Pitch']=2.879793,['SizeY']=620,},[9]={['Yaw']=5.511750,['Y']=13649,['X']=90935,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Tagebuch des Bulgrash /Diary of Bulgrash',['message']='Fredas der 31te\\nJetzt im Monat des Sonnenuntergangs werden die Tage kürzer.\\nWir graben nun schon seit Wochen, und endlich haben wir das Glück auf unserer Seite.\\nWir haben etwas gefunden, zwei alte Särge, und ein Heiligtum mit mir unbekannten Symbolen.\\nIndur hat mir geraten das ding in Ruhe zu lassen. In letzter Zeit ist mir etwas aufgefallen an Indur, ich weiß nur nicht was. Vieleicht aber ist er nur ein Feigling.\\nGleich werde ich den zweiten Sarg öffnen, und dann werden wir sehen\\nob wir als reiche Männer diese Grube verlassen.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDiary of Bulgrash\\n\\nFredas the 31th\\nNow in the month of the sunset, the days are getting shorter.\\nWe\\'ve been digging for weeks now, an the luck is finally on our side.\\nWe found something, two old coffins and a sanctuary with symbols i don\\'t know.\\nIndur  advised me to leave the thing alone. Lately I\\'ve noticed somthing about Indur, but I don\\'t know what it is. But maybe he\\'s just a coward.\\nI\\'ll start  to open the second coffin in a moment, and then we\\'ll see if we leave this pit as rich men..\\n',},['Color']=170867,['Z']=58213,['Roll']=0,['SizeZ']=36,['Contrast']=1,['Id']=1622,['SizeX']=31.456456,['Pitch']=1.047198,['SizeY']=36,},[10]={['Yaw']=0.383972,['Y']=10183,['X']=102202,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Tagebuch von Ambron Margolia / Diary of Ambron Margolia',['message']='Mein Name ist Ambron Margolia,\\nich wurde vor 35 Jahren in Wegesruh geboren.\\nMein Vater arbeitete sein leben lang als Diener im Palast.\\nSo wollte ich nicht enden. \\nIch beschloss mein Glück im Schmuggel zu versuchen.\\nDas Risiko ist hoch, aber der Gewinn auch.\\nZuerst haben wir, das sind mein kumpel Indur-sa und ich, Skooma\\naus Elsweyr nach Wegesruh verschifft, und damit viel Gold verdient.\\nJetzt aber haben wir aber etwas neues oder besser altes entdeckt, das sich mit viel mehr gewinn verkaufen läßt, Antiquitäten.\\nJe geheimnissvoller die Antiquität, desto höher der Gewinn.\\nGerade hat Indur eine neue Antiquität gebracht, ich bin gespannt was es ist. Zur Feier des Tages hat er mir auch noch einen besonderen Trunk mitgebracht, den will ich mir schmecken lassen.\\nIch bin froh, das ich Indur habe, er würde mich nie hintergehen...\\n\\n\\n\\nMy name is Ambron Marcolia.\\nI was born in Wayrest, 35 years ago.\\nMy father worked as a servant in the palace all his life.\\nI didn\\'t want to end like him.\\nI decided to try my luck at smuggling, the risk is high, but so is the profit.\\nFirst of all, we, my buddy Indur-Sa and I, shipped skooma from Elsweyr and earned a lot of gold with it.\\nBut now we have discovered something new, or rather old, that can be sold with much more profit, antiques.\\nThe more mysterious the antiques, the higher the profit.\\nIndur has just brought a new antique. I\\'m curious what it is. \\nTo celebrate the day, he also brought me a special drink, that i want to enjoy.\\nI\\'m glad i have Indur, he would never betray me...\\n\\n',},['Color']=140099,['Z']=57444,['Roll']=0,['SizeZ']=43,['Contrast']=1.560000,['Id']=1623,['SizeX']=34.456456,['Pitch']=4.799655,['SizeY']=43,},[11]={['Yaw']=3.689626,['Y']=13587,['X']=98580,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Wachbuch /Guard Book',['message']='Fredas der 31 im Monat des Eisherbsts\\nHeute haben wir einen neuen Gefangenen bekommen.\\nEr ist plötzlich hier aufgetaucht, aus dem nichts.\\nSein verhalten ist sehr merkwürdig.\\nEr wirkt völlig teilnahmslos, und spricht nicht.\\nSeine Haut ist ganz fahl. Einen solchen typen habe ich noch nie gesehen.\\nUnser Legat will ihn sich nachher ansehen.\\n\\nDer Khajiit in seinem Labor arbeitet die ganze Nacht.\\nSeine Frau hat sich mit dem Assistenten davongemacht.\\nDie beiden waren schon lange ein paar, aber Biro-Dar\\nhat nichts bemerkt., was für ein trottel.\\n\\nDie Archäologin hat unten im Keller eine Entdeckung gemacht.\\nSie ist schon ganz aufgeregt, und irgendwas hat dieser Ork hinten ausgegraben, ich werde es mir später ansehen.\\nDiesen Indur-Sa muss ich mir mal genauer ansehen, irgendwas stimmt mit ihm nicht. Er ist plötzlich verschwunden, gerade als der neue Gefangene hereinkam.\\n\\nToday we got a new prisoner.\\nHe showed up here suddenly, out of nowhere.\\nHis behavior is very strange.\\nHe seems completely unresponsive, and does not speak to us.\\nHis skin is very pale. I\\'ve never seen one like this.\\nOur Legat wants to see him later.\\n\\nThe Khajiit in his laboratory worked all night. His wife took off with the assistant. The two had been a couple for a long time, but Biro-Dar didn\\'t notice anything, what a fool.\\n\\nThe archaeologist made a discovery down in the basement.\\nShe\\'s very excited, and something those Orcs dug up in the back, I\\'ll have to go see it later.\\n\\nI have to take a closer look at Indur-Sa, something is wrong with him.\\nHe suddenly disappeared just as the new prisoner came in.',},['Color']=211061,['Z']=55724,['Roll']=0,['SizeZ']=40,['Contrast']=1,['Id']=1624,['SizeX']=30.456456,['Pitch']=4.886922,['SizeY']=40,},[12]={['Yaw']=5.969026,['Y']=13925,['X']=101522,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Tagebuch des Biro Dar / Diary of Biro Dar',['message']='Es muss doch jetzt passieren.\\nIch habe es immer und immer wieder berechnet.\\nDas Ereignis muss heute stattfinden.\\nGut, die ersten Berechnungen waren fehlerhaft, aber\\ndas lag an diesem inkompetenten Assistenten Indur-Sa.\\nNun aber habe ich die Daten selbst erhoben, und neu berechnet. \\nJone und Jode werden sich verdecken.\\nDie Okulation findet in dieser Nacht statt.\\nMeine Frau Nuzhimeh wird mich um Entschuldigung bitten müssen.\\nIndur-Sa hat sehr viel Zeit mit meiner Frau verbracht. Nun begleitet er Sie zu einem Besuch Ihrer Eltern. Ich werde ihn danach entlassen. Er hat mir eine Flasche Wein geschenkt.\\nIch werde ihn heute Nacht geniessen, zu meinem großen Triumph.\\n\\nPS:Komisch ich dachte Ihre Eltern wären Tot?\\n\\n\\n\\n\\nDiary of Biro-Dar\\n\\nIt has to happen now.\\nI\\'ve calculated it over and over again.\\nThe event must take place today.\\nWell, the first calculations were wrong, but that\\nwas due to this incompetent assistant Indur-Sa.\\nBut now I have collected the data myself and recalculated it.\\nJone and Jode will cover up.\\nThe eclipse takes place that night.\\nMy wife Nuzhimeh will have to apologize me.\\nBut I will not employ Indur-Sa again, who has spend a lot of time with my wife. He accompanies my wife on a visit to her parents.\\nHe brought me a particular drop. I will enjoy it this night, to my great triumph.\\n\\nFun fact, i thought her parents were dead?',},['Color']=483099,['Z']=56027,['Roll']=0,['SizeZ']=41,['Contrast']=1,['Id']=1625,['SizeX']=31.456456,['Pitch']=5.396558,['SizeY']=41,},[13]={['Yaw']=1.947787,['Y']=16626,['X']=90541,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Tagebuch von Nuzhimeh Dar / Diary of Nuzhimeh Dar',['message']='Hier  fühle ich mich so frei, und kann meinen Gedanken nachgehen.\\nIch liebe ihn so sehr, also nicht meinen Ehemann, sondern Indur-Sa, seinen Assitenten. Er ist immer so aufmerksam, und so zärtlich. Er tut dinge, die mein Ehemann niemals tun würde. Biro bemerkt mich kaum noch, er ist so in seine Arbeit vertieft. Phh, \"Arbeit\", er schaut die ganze Nacht durch ein Fernrohr, das ist doch keine Arbeit.\\nIch werde ihn verlassen.\\nDas Schiff dort unten könnte mich von all dem wegbringen.\\nIch möchte die ganze Welt sehen, und von einem Paradis zum anderen Reisen. Morgen werden wir zu dieser Reise aufbrechen. Indur holt mich ab. Zur Feier des tages hat mir Indur einen besonderen Trank mitgebracht. Ich werde ihn nachher trinken, und dabei an ihn denken.\\n\\n\\n\\n\\n\\n\\n\\n\\nHere I feel so free, and can pursue my thougts.\\nI love him so much, not my husband, but Indor-Sa, his assistant.\\nHe\\'s always so attentive and so tender. He does things, my husband would never do.\\nBiro hardly notice me anymore, he\\'s so absorbed in his \"work\". Phh \"work\", he looks all night through a telescope, that\\'s no work.\\nI will leave him.\\n I want to see the hole world, and travel from one paradise to another.\\nThe ship down there could bring me away from it all.\\nTomorrow we will start this journey. Indur pick me up.\\nTo celebrate this day, Indur brought me a special drink.\\nI\\'ll drink it afterwards, thinking of him.',},['Color']=291798,['Z']=53857,['Roll']=0,['SizeZ']=50,['Contrast']=1,['Id']=1626,['SizeX']=35.456456,['Pitch']=4.719370,['SizeY']=50,},[14]={['Yaw']=5.260422,['Y']=13345,['X']=92798,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Wachbuch /Guard Book',['message']='Fredas der 31 im Monat des Eisherbsts\\nHeute haben wir einen neuen Gefangenen bekommen.\\nEr ist plötzlich hier aufgetaucht, aus dem nichts.\\nSein verhalten ist sehr merkwürdig.\\nEr wirkt völlig teilnahmslos, und spricht nicht.\\nSeine Haut ist ganz fahl. Einen solchen typen habe ich noch nie gesehen.\\nUnser Legat will ihn sich nachher ansehen.\\n\\nDer Khajiit in seinem Labor arbeitet die ganze Nacht.\\nSeine Frau hat sich mit dem Assistenten davongemacht.\\nDie beiden waren schon lange ein paar, aber Biro-Dar\\nhat nichts bemerkt., was für ein Trottel.\\n\\nDie Archäologin hat unten im Keller eine Entdeckung gemacht.\\nSie ist schon ganz aufgeregt, und irgendwas hat dieser Ork hinten ausgegraben, Ich werde es mir später ansehen.\\n\\nDiesen Indur-Sa muss ich mir mal genauer ansehen, irgendwas stimmt mit ihm nicht. Er ist plötzlich verschwunden, gerade als der neue Gefangene hereinkam.\\n\\nToday we got a new prisoner.\\nHe showed up here suddenly, out of nowhere.\\nHis behavior is very strange.\\nHe seems completely unresponsive, and does not speak to us.\\nHis skin is very pale. I\\'ve never seen one like this.\\nOur Legacy wants to see him later.\\n\\nThe Khajiit in his laboratory worked all night. His wife took off with the assistant. The two had been a couple for a long time, but Biro-Dar didn\\'t notice anything, what a fool.\\n\\nThe archaeologist made a discovery down in the basement.\\nShe\\'s very excited, and somthing this Orc dug up in the back, I\\'ll have to go see it later.\\n\\nI have to take a closer look at  Indur-Sa, something is wrong with him.He suddenly disappeared just as the new prisoner came in.',},['Color']=211061,['Z']=53357,['Roll']=0,['SizeZ']=42,['Contrast']=1.860000,['Id']=1627,['SizeX']=33.456456,['Pitch']=5.235988,['SizeY']=42,},[15]={['Yaw']=2.904228,['Y']=10205,['X']=103047,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Tagebuch der Indur-Sa / Diary of Indur-Sa',['message']='Ha ha ha, es war so leicht, alle haben mir vertraut, die dunkle Bruderschaft wird mich nun aufnehmen müssen.\\n\\nZuerst Ambron, er war so vertrauensselig, er kam nie auf den Gedanken das unsere \"Freundschaft\" nur gespielt war.\\n\\nNuzihmeh, die hübsche kleine Rothwardonin, so süchtig nach Aufmerksamkeit und liebe, sie wird mir ein wenig fehlen.\\n\\nIhr Ehemann Biro, ein garstiger Khajiit, wollte mir die Arbeit überlassen und allein den Ruhm ernten.\\n\\nAlle drei haben meinen \"Spezialtrunk\" bekommen, er wird sie sehr überraschen, hehe\\n\\nDer Ork, Bulgrash, hätte mich fast durchschaut, aber ein wenig Feuersalz in seinem Bohrer, hat ihn schnell \"beruhigt\".\\n\\nIm Sarg oben habe ich diesen Schlüssel gefunden. Ich glaube das ist ein Portalschlüssel der Dwemer, der mich dorthin bringt wohin ich will.\\nBulgrash, der Ork, meinte, der Schlüssel könnte mich auch direkt zu Molag Bal bringen, was weiss der schon, er ist tot, hehe.\\nJetzt wird es Zeit, das ich hineingehe....\\n\\n- - - - - - - - - - - - - - - - \\n\\n\\nHa ha ha, it was so easy, everyone trusted me, the dark brotherhood will now have to take me in.\\n\\nFirst Ambron, he was so trusting that he never thougt that our \"friendship\" was just an act.\\n\\nNuzihmeh, the pretty little redguard women, so addicted to attention and love, I\\'ll miss her a little.\\n\\nHer husband Biro, a nasty Khajiit, wanted to let me do all the work and reap the glory alone.\\n\\nAll three got my \"special\" drink, it will surprise them, hehe\\n\\nThe fat Orc almost saw trough me, but a little firesalt in his drill \"calmed him down\" hehe.\\n\\nI found this key in the coffin above. I believe this is a Dwemer portal key, that take me wherever i want. Bulgrash, the Orc, said the key could take me directly to Molag Bal, but what does he know, he\\'s dead, hehe.\\nNow it\\'s time, i\\'m going in',},['Color']=341099,['Z']=57418,['Roll']=0,['SizeZ']=37,['Contrast']=1,['Id']=1628,['SizeX']=31.456456,['Pitch']=4.712564,['SizeY']=37,},[16]={['Yaw']=0.785398,['Y']=5007,['X']=94532,['EffectType']=87,['Groups']=0,['Alpha']=0.580000,['Id']=1629,['Z']=59886,['Roll']=0,['SizeZ']=600,['Contrast']=0.640000,['Color']=554545,['SizeX']=700,['Pitch']=3.228859,['SizeY']=600,},[17]={['Yaw']=0.174533,['Y']=5007,['X']=94442,['EffectType']=87,['Groups']=0,['Alpha']=0.600000,['Id']=1630,['Z']=59802,['Roll']=0,['SizeZ']=580,['Contrast']=0.640000,['Color']=554545,['SizeX']=700,['Pitch']=3.228859,['SizeY']=580,},[18]={['Yaw']=2.268928,['Y']=5047,['X']=94387,['EffectType']=87,['Groups']=0,['Alpha']=0.540000,['Id']=1631,['Z']=59660,['Roll']=0,['SizeZ']=660,['Contrast']=0.640000,['Color']=554545,['SizeX']=700,['Pitch']=3.228859,['SizeY']=660,},[19]={['Yaw']=4.087561,['Y']=13325,['X']=92968,['EffectType']=4405,['Alpha']=1,['Groups']=0,['MetaData']={['message']='For the answer',},['Color']=999999,['Z']=52806,['Roll']=0,['SizeZ']=15,['Contrast']=1,['Id']=1632,['SizeX']=66,['Pitch']=0,['SizeY']=15,},[20]={['Yaw']=4.111996,['Y']=13312,['X']=92968,['EffectType']=4405,['Alpha']=1,['Groups']=0,['MetaData']={['message']='please read',},['Color']=999999,['Z']=52804,['Roll']=0,['SizeZ']=12,['Contrast']=1,['Id']=1634,['SizeX']=57,['Pitch']=0,['SizeY']=12,},[21]={['Yaw']=4.111996,['Y']=13297,['X']=92968,['EffectType']=4405,['Alpha']=1,['Groups']=0,['MetaData']={['message']='the (red) diaries',},['Color']=999999,['Z']=52804,['Roll']=0,['SizeZ']=15,['Contrast']=1,['Id']=1635,['SizeX']=62,['Pitch']=0,['SizeY']=15,},[22]={['Yaw']=4.080580,['Y']=13386,['X']=92970,['EffectType']=4405,['Alpha']=1,['Groups']=0,['MetaData']={['message']='Welcome',},['Color']=999999,['Z']=52806,['Roll']=0,['SizeZ']=15,['Contrast']=1,['Id']=1636,['SizeX']=66,['Pitch']=0,['SizeY']=15,},[23]={['Yaw']=4.653048,['Y']=4617,['X']=96186,['EffectType']=8501,['Alpha']=1,['Groups']=0,['MetaData']={['title']='Expeditionstagebuch/ Expedition Diary',['message']='Mein Name ist Phedre, ich bin Historikerin.\\nDas ist meine erste Exkursion die ich allein durchführen darf.\\nEigentlich ging es nur um das große Tor oben, das niemand aufbekam.\\nDann habe ich Indur-Sa beobachtet, wie er einen versteckten Schalter betätigte, und durch das Tor ging. Als er weg war, tat ich es ihm nach, und das Tor ging auf.\\nIch stieg nach unten, und komme seit dem aus dem Staunen nicht mehr heraus. Wenn ich das dem Antiquar erzähle, er wird mir nicht glauben.\\nSpäter werde ich noch die Falltür hinten genauer untersuchen, ich bin gespannt, wohin sie führt.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nMy name is Phedre, and I am a historian.\\nThis is my first excursion that i can do alone.\\nActually, it was just about the big gate upstairs that nobody could open.\\nThen I watched Indur-Sa flick a hidden switch and walk through the gate.\\nWhen he was gone I did the same and the gate opened. I went downstairs and have be amazed since then. \\nIf i tell this to the antiquarian, he won\\'t believe me.\\nLater I will examine the trapdoor in more detail. I\\'m curious where it leads.',},['Color']=120099,['Z']=60497,['Roll']=0,['SizeZ']=50,['Contrast']=1,['Id']=1638,['SizeX']=46.456456,['Pitch']=4.799655,['SizeY']=50,},[24]={['Yaw']=5.358161,['Y']=10337,['X']=103585,['EffectType']=4499,['Groups']=0,['Alpha']=0.820000,['Id']=1639,['Z']=56723,['Roll']=0,['SizeZ']=660,['Contras