R["fx__na__@ichsuisme__34"]="{['TS']=1623518341,['Effects']={[1]={['EffectType']=8501,['Y']=3073,['X']=72831,['Id']=1696,['Color']=152699,['Contrast']=1,['Alpha']=1,['Yaw']=4.712389,['Z']=36949,['Pitch']=1.570971,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['SizeX']=26.456456,['MetaData']={['message']='This place was always a struggle for my parents: a redguard father who refused to be happy and a dark elf mother who never fully acclimated to the desert. I\\'m worried I won\\'t be any better off. This is what they\\'ve left me though, so, here I am: unhappy, unaclimated, and also alone.\\n\\nThe years haven\\'t been kind to this place. Looks like after we left the house has been ransacked a couple times over. I\\'ll salvage whet I can around here and then I\\'ll start tilling the soil. What even grows in such sandy soil? I\\'ll have to ask around in town. I\\'ll be the farmer that neither of my parents were.\\n\\nWill the future be kinder to this place than the past? Will the future be kind to me? Whatever the answer to that question, the fact is: I\\'ve got no where else to be.\\n\\n\\n\\n\\n\\nUse /sleep on the bed, then say: \"I DREAM FOR A FUTURE\"',['title']='Inheiritance, day 1',},},[2]={['EffectType']=5018,['Y']=2514,['X']=73362,['Id']=1698,['Color']=696968,['Contrast']=1,['Alpha']=1,['Yaw']=4.712389,['Z']=37037,['Pitch']=0,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['SizeX']=130,['MetaData']={['message']='Read the book',['name']='Voice',},},[3]={['EffectType']=4405,['Y']=8110,['X']=70494,['Id']=1699,['Color']=939393,['Contrast']=4,['Alpha']=1,['Yaw']=3.117158,['Z']=37862,['Pitch']=0,['SizeZ']=40,['Groups']=0,['SizeY']=40,['Roll']=0,['SizeX']=140,['MetaData']={['message']='Master Reset',},},[4]={['EffectType']=8501,['Y']=3154,['X']=73422,['Id']=1700,['Color']=364398,['Contrast']=1.320000,['Alpha']=1,['Yaw']=6.279695,['Z']=36038,['Pitch']=5.497787,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['SizeX']=26.456456,['MetaData']={['message']='I\\'ve made myself proud with the progress I\\'ve made here. The outside looks great! I was able to get up and running within just a few months! It\\'s been hard, but I\\'ve been happy here. I hope my crops will sell well at the market.\\n\\nAnyway, ancestors, if I may ask for something, I ask for forgiveness! I previously misremembered my time with my parents here at this house. I hated growing up here. The hot, dusty air once felt so suffocating, but now it warms me from within. The sun makes me appreciate the shade my humble, inheirited home provides. The sandy wind used to sting my eyes... and well, it still stings, but I don\\'t even mind!\\n\\nComing back here was a chance to start over and I pray that you have all seen that I haven\\'t let this go to waste. Please, grant me your blessings. Mom, Dad, I pray I have yours as well.\\n\\n\\n\\nOnce you have gone outside and looked at the garden, come back to this shrine and use the emote: /pray then say: \"I PRAY FOR A FUTURE\"',['title']='Ancestral Worship',},},[5]={['EffectType']=5018,['Y']=3102,['X']=73596,['Id']=1701,['Color']=696968,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=35651,['Pitch']=0,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['SizeX']=130,['MetaData']={['message']='Read the book then /pray',['name']='Voice',},},[6]={['EffectType']=8503,['Y']=8106,['X']=72047,['Id']=1702,['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=35794,['Pitch']=4.712564,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['SizeX']=26.456456,['MetaData']={['message']='A mage moved into town. He reminded me of all those years ago when I arrived here. The first day after he was settled, he came to my market stall and admitted he\\'d already heard good things about my green thumb and my plants. He asked me to grow specific plants for his magical pursuits.\\n\\nThe plants have odd requirements: potions of strange concoctions but I\\'ve had success with them all. The mage seems pleased. The plants are fascinating, I\\'d grow these for free, but the mage insisted on paying. He even wants to pick them up himself to save me the trouble. Very thoughtful of him. I might use the extra gold to get a puppy... or two.\\n\\n\\n[Sit in the chair, admire the scene, then say \"A MAGICAL FUTURE\"',['title']='A Mage and Some Herbs',},},[7]={['EffectType']=8503,['Y']=3105,['X']=72961,['Id']=1703,['Color']=102439,['Contrast']=1.250000,['Alpha']=1,['Yaw']=0,['Z']=35773,['Pitch']=0,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['SizeX']=26.456456,['MetaData']={['message']='After just one year of dating, here we are: I married the mage, right here at home. Our relationship started with him picking up his deliveries instead of getting them at the market. Then he started bringing dinner. And then, well, he started making breakfast. He\\'s a catch. Plus he\\'s nice to my dogs.\\n\\nEverything I have in this life I owe to this house. It has fixed my past by letting me forgive my parents. It has fixed me by giving me confidence, a work ethic, and a passion for life. It has given me place to fall in love.\\n\\nI\\'ve never known what the future holds for me, but this house will stay with me forever; with that said, it\\'s time for me to move out. I\\'m moving into the mage\\'s tower with my husband. The agreement that we have is that if I can get a plant to grow, I can grow it anywhere in the tower--oh boy, do I have plans.\\n\\n\\nIf we adopt children, this house will be their inheiritance. This might be the greatest gift I can give them. I hope they make their own memories here and grow up into wise, talented people. And if we don\\'t adopt, I leave this house to anyone who promises to enjoy it--just water the flowers and tell them I say hello. They\\'re some of my greatest and oldest friends.',['title']='The Past and the Unknown Future',},},[8]={['EffectType']=4405,['Y']=8278,['X']=70103,['Id']=1705,['Color']=999998,['Contrast']=1,['Alpha']=1,['Yaw']=2.617994,['Z']=37723,['Pitch']=0,['SizeZ']=40,