roups']=0,['SizeZ']=312,['Color']=321033,['Z']=37836,['EffectType']=422,['SizeY']=312,['X']=37990,['Roll']=0,['SizeX']=212,['Alpha']=0.860000,['Y']=26256,['Id']=2978,},[53]={['Pitch']=1.658063,['Yaw']=5.061455,['MetaData']={['message']='The Foreign Prince required:\\n  1,000 crowns of fine wine\\n  1,000 crowns of sparkling cake\\n                          (house specialty)\\n  2,000 crowns to rent out the whole place for a party last night\\n\\nHe paid with a one-of-a-kind music box. Seems to be magical. Accepted it over the gold, because, well maybe the grape vines will like the songs?  Also the prince was cute.',['title']='A Very Large Bar Tab',},['SizeX']=26.456456,['Contrast']=1.750000,['Groups']=0,['Color']=173965,['Z']=37927,['SizeZ']=30,['SizeY']=30,['X']=38158,['Roll']=0,['EffectType']=8502,['Alpha']=1,['Y']=26397,['Id']=2979,},[54]={['Pitch']=0,['Yaw']=1.570796,['MetaData']={['furniture']='4615572040412943797',},['SizeX']=1600,['Contrast']=1,['Groups']=0,['Color']=494949,['Z']=39318,['SizeZ']=1000,['SizeY']=1000,['X']=37055,['Roll']=0,['EffectType']=992,['Alpha']=1,['Y']=26351,['Id']=2980,},[55]={['Pitch']=5.759587,['Yaw']=5.061455,['MetaData']={['message']='I\\'m leaving this note because I\\'m a coward but also an optimist. Hopefully someone comes across it on their way to The Tipsy Neighbor and gives it to you.\\n\\nKeldora put me on the spot. She kept asking if I was royalty. I said I was just to get her to stop. I didn\\'t know the lie would lead to our introduction. If I could go back, I would\\'ve introduced myself honestly from the start. To you, especially.\\n\\nI am not a prince. I\\'m a soldier who did a mage a favor and came into a priceless magical item. I\\'m also just a soldier who is scared to go to cyrodiil. I was living last night as my last, sparing no expense. You instantly made me want to stay, but it\\'s not an option. Hope you\\'ll forgive me.\\n\\nI think last night was serendipity. You felt good, like destiny. Hopefully I get a chance to come back.\\n\\n-xoxo not a prince',['title']='i am not a prince',},['SizeX']=26.456456,['Contrast']=1,['Groups']=0,['Color']=879995,['Z']=39573,['SizeZ']=30,['SizeY']=30,['X']=39664,['Roll']=0,['EffectType']=8503,['Alpha']=1,['Y']=21232,['Id']=2981,},[56]={['Pitch']=0,['Yaw']=3.141593,['MetaData']={['furniture']='4615572040412943797',},['SizeX']=1400,['Contrast']=1,['Groups']=0,['Color']=494949,['Z']=37843,['SizeZ']=1000,['SizeY']=1000,['X']=37993,['Roll']=0,['EffectType']=992,['Alpha']=1,['Y']=27429,['Id']=2982,},},}"
