R["fx__eu__@strike4__61"]="{['Effects']={[1]={['Contrast']=1.250000,['SizeY']=80,['Pitch']=6.248279,['Roll']=0,['Yaw']=3.096214,['Z']=53827,['X']=36241,['MetaData']={['message']='RAHZARHDARK CITY',},['Groups']=0,['Color']=235277,['Y']=15202,['Id']=1772,['Alpha']=0.750000,['SizeZ']=80,['EffectType']=4406,['SizeX']=640,},[2]={['Contrast']=1.360000,['SizeY']=43,['Pitch']=5.047492,['Roll']=0,['Yaw']=3.033382,['Z']=60899,['X']=35695,['MetaData']={['title']='Buch der Erinnerung/Book of Memory',['message']='Hier liegt Athand Bthaal, Lord von Hammerfell, bewahrer der Flammenklinge.\\n\\nSchwer verletzt nach der Schlacht am Rotem Berg, ist Athand Bthaal hier von Rhagar Dotharn, dem Heiler, in diese Regenerationskammer gelegt worden und wartet auf seine Genesung.\\nBesucher, zeigt Respekt vor diesem Helden und verneigt euch.\\n\\nAthand Bthaal wird eines Tages zurückkehren, und das Schicksal Tamriels neu bestimmen.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nBook of Memory\\n\\nHere lies Athand Bthaal, Lord of Hammerfell, Keeper of the Flame Blade.\\n\\nSeriously injured after the battle of the Red Mountain, Athand Bthaal is placed here from Rhagar Dotharn, the healer. Athand Bthaal waits for his recovery in this regeneration chamber.\\n\\nVisitors, show respect and bow to this hero, who will return one day, and redifined the fate of Tamriel.',},['Groups']=0,['Color']=140861,['Y']=14890,['Id']=1773,['Alpha']=0.930000,['SizeZ']=43,['EffectType']=8502,['SizeX']=32.456456,},[3]={['Contrast']=1,['Pitch']=0,['Roll']=0,['Yaw']=3.103195,['Z']=61969,['X']=33193,['Color']=991926,['Groups']=0,['SizeY']=420,['Alpha']=1,['Id']=1775,['Y']=13480,['SizeZ']=420,['EffectType']=645,['SizeX']=420,},[4]={['Contrast']=1,['Pitch']=0,['Roll']=0,['Yaw']=3.103195,['Z']=61967,['X']=33219,['Color']=372799,['Groups']=0,['SizeY']=380,['Alpha']=1,['Id']=1776,['Y']=13480,['SizeZ']=380,['EffectType']=645,['SizeX']=380,},[5]={['Contrast']=1,['Pitch']=0,['Roll']=0,['Yaw']=3.103195,['Z']=61985,['X']=33211,['Co