R["fx__@eleth"]="{['Houses']={[1]={['HouseId']=2,['World']='eu',['Effects']={[1]={['Id']=1003,['Roll']=0,['Y']=20159,['SizeX']=26.456456,['Groups']=0,['Yaw']=2.595305,['Color']=102439,['Z']=27053,['SizeY']=30,['EffectType']=8502,['Alpha']=0,['SizeZ']=30,['Contrast']=1,['X']=22188,['MetaData']={['title']='Journal',['message']='Loredas, 24th Rain\\'s Hand 2E581\\n\\nI\\'ve reached Daggerfall a few days ago and found a cheap room at an inn. It\\'s cheap because it\\'s noisy and beside a bed it\\'s unfurnished.. But I don\\'t need much.\\n\\n\\n\\nTurdas, 28th Rain\\'s Hand 2E581\\n\\nI\\'m finding some small jobs. Mostly guard jobs for merchants in the aerea, but it\\'s a start. I\\'ve been furnishing the room with stuff from the attic or such and no one needed. At least Gregoire doesn\\'t seem to mind.. \\n\\n\\n\\nSundas, 2nd Second Seed 2E581\\n\\nAlright.. dragging a desk down from the attic did pissed him off. \\n\\n\\n\\nMorndas, 17th Second Seed 2E581\\n\\nI\\'m finding more and more work, I guess I\\'ve started to make a bit of a name as a guard meanwhile. And I met yesterday this guy, Merton. We were chatting together with Grobert while having some ales. He invited me to join him on a fishing tour in a few days. \\n\\n\\n\\nFredas, 11th Midyear  2E581\\n\\nSo.. I was reading today in my room. I had the windows open and a cat just jumped in. They started to go around the room like they were inspecting it. They are still here and taking a nap on my bed.\\n\\n\\n\\nMorndas, 20th Midyear 2E581\\n\\nChou, the cat is still here.. She brought a friend in. I\\'ll be gone for a few days for a contract. Urvie will look after them while I\\'m gone. Also.. I keep seeing Merton. He\\'s nice.\\n\\n\\n\\nTirdas, 13th Sun\\'s Height 2E581\\n\\nMerton organized a job for me. He\\'s working as a guard for Jacmund Dusant, a local noble. Lutin, the other cat is just so adorable.. \\n\\n\\n\\nFredas, 30th Sun\\'s Height 2E581\\n\\nMerton and I are getting along well. The cats seem content and working for Dusant isn\\'t half as bad. He\\'s incredibly paranoid. But other than that he\\'s almost likeable for a noble.\\n',},['Pitch']=4.799655,},},['TS']=1613945763,['Version']='16.2.0',},[2]={['HouseId']=72,['World']='eu',['Effects']={[1]={['Roll']=0,['SizeX']=4000,['X']=77960,['Groups']=0,['Yaw']=1.406735,['Contrast']=1.250000,['Z']=76487,['Id']=1005,['EffectType']=984,['Alpha']=0.750000,['SizeZ']=4000,['Color']=994242,['SizeY']=1,['Y']=11538,['Pitch']=0,},[2]={['Roll']=0,['SizeX']=4000,['X']=78241,['Groups']=0,['Yaw']=1.406735,['Contrast']=1.250000,['Z']=78962,['Id']=1006,['EffectType']=984,['Alpha']=0.750000,['SizeZ']=4000,['Color']=994242,['SizeY']=1,['Y']=11518,['Pitch']=0,},},['TS']=1616259958,['Version']='16.3.5',},[3]={['HouseId']=42,['Effects']={},['World']='eu',['TS']=1616606037,['Version']='16.3.5',},[4]={['HouseId']=19,['Effects']={},['World']='eu',['TS']=1620081340,['Version']=1724,},},['TS']=1620081340,['Key']='fx__@eleth',}"
