zeX']=39.279147,['Pitch']=6.195919,['Id']=1703,['SizeY']=400,['Groups']=0,['Yaw']=5.061455,['SizeZ']=400,['Color']=999999,['Roll']=0,['Y']=26704,['Contrast']=1,},[90]={['EffectType']=8503,['X']=132223,['Alpha']=1,['SizeZ']=30,['Z']=100200,['SizeX']=26.456456,['Id']=1704,['MetaData']={['message']='\\n\\nOctober 25\\nPartly unthawed a section in the back of the cave and noticed a slight movement in the ice. Took a few samples and was able to establish biological activity. Unknown life force. Potential danger. Placed mag barrier as a precaution.\\n\\nNovember 18\\nThis creature must have been flash-frozen ages ago. He says his name is Santaclaws. Very violent. Anger issues. Chaotic outbursts, growling, frothing at the mouth.\\n\\nAlso, some artifacts have emerged in the thawing ice. I wish I could get a closer look. There\\'s a tree with a bunch of colorful lights. It\\'s very pretty actually. What a novel idea. (I bet that could become a trend in town!) Some items under the tree but I am not able to get any info on them from this distance.\\n\\n\\nDecember 23\\nI\\'ve been having conversations of sorts with this creature. He seems to think that he\\'s been infected with a virus that turned him into his current physical state. My sceptical response threw him into a rage. He says he must be let out. Something about driving a sled in the sky and delivering packages to little children. He is clearly unstable, possibly insane. I\\'m erecting a second force field barrier to make sure he won\\'t get out.\\n\\n',['title']='Phedre\\'s Research Notes',},['Pitch']=5.061455,['Groups']=0,['Y']=26758,['SizeY']=30,['Color']=192399,['Roll']=0,['Yaw']=4.701917,['Contrast']=1,},[91]={['EffectType']=197,['X']=132593,['Alpha']=1,['Z']=99795,['SizeX']=960,['Pitch']=0,['Id']=1706,['SizeY']=1007,['Groups']=0,['Yaw']=5.672320,['SizeZ']=1007,['Color']=998043,['Roll']=0,['Y']=27189,['Contrast']=1,},[92]={['EffectType']=963,['X']=133384,['Alpha']=1,['Z']=100622,['SizeX']=740,['Pitch']=0,['Id']=