urring and purring until she fell asleep. This gorgeous creature adopted me.  I am so honored. And it is true, I could use some company around here. I\\'ve named her Gorgonzola. \\n\\nGorgonzola has already found a favorite chair!\\n \\nShe has giant teeth. Funny I didn\\'t notice that earlier. It looks hilarious. I guess she\\'ll grow into them eventually.\\n\\n',['title']='Gorgonzola',},['SizeZ']=30,['Groups']=0,['Y']=20166,['Pitch']=1.658063,['SizeY']=30,['Color']=281999,['Yaw']=1.308997,['Contrast']=1,},[10]={['EffectType']=8503,['X']=26063,['Alpha']=1,['Roll']=0,['Z']=26435,['SizeX']=26.456456,['Id']=1548,['MetaData']={['message']='          Dear Diary. I have not written about this until now but I think one of our regular customers at the deli have taken a fancy to me. He is kind of cute but...awkward. Uptight. Maybe a bit nervous. And he orders the same thing every single day; breakfast burrito. Funny.\\n          Anyway, this past week things changed. It\\'s like..well, he started talking and smiling and even laughing. He even let me talk him into ordering a grilled cheese instead of that burrito - big day haha!\\n          \\n          Dear Diary. So I\\'ve learned that his name is Tythis and that he\\'s an accountant and works from home. Lives in town with his dog, Harold. Oh and he plays the mandolin <3 \\n\\n          Dear Diary. Tythis has asked me out. He wants to bring me to one of those fancy restaurants down on the boardwalk, right by the docks. I said yes. \\nAfter giving it some more thought, I\\'m bringing Gorgonzola. Tythis seemed almost relieved since he had wanted to bring Harold but was afraid I wouldn\\'t like that.\\n\\n          Dear Diary. Getting ready for the dinner with Tythis. I am all butterflies!',['title']='My Diary',},['SizeZ']=30,['Groups']=0,['Y']=20166,['Pitch']=4.712564,['SizeY']=30,['Color']=992577,['Yaw']=0.610865,['Contrast']=1,},[11]={['EffectType']=4506,['SizeZ']=140,['Alpha']=1,['Z']=26608,['SizeX']=120,['Id']=1612,['X']