fectType']=8502,['Y']=20338,['X']=26041,['MetaData']={['message']='And so, the boat which no longer welcomed the two men, left them on the shores of the imperial lake.\\n\\nNow exiled, they nervously wondered what might come next -- though these two men were more excited to be finally unburdened by the idola theatri.\\n\\nThe men were free to think for themselves.',['title']='The End',},['Color']=849699,['Contrast']=1.450000,['Alpha']=1,['Yaw']=3.141593,['Z']=23147,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=1.396263,['Id']=1020,},},['Version']='15.7.9',['HouseId']=19,['TS']=1604263044,},[2]={['World']='na',['Effects']={[1]={['EffectType']=8503,['Y']=27832,['X']=164548,['MetaData']={['message']='There are secrets hidden within the mountain. Look for areas that are lit up by colored lights. There are six: red, orange, yellow, green, blue, and purple.\\n\\nOnce you\\'ve found those six, there is also one unmarked secret area you can try to find. Although this one has no light to guide you to it. Here is your one hint: go to the top of the mountain then think where you havent been yet. This is the biggest secret with lots to see, hope you find it!',['title']='Exploration is key!',},['Color']=999999,['Contrast']=1,['Alpha']=1,['Yaw']=2.439970,['Z']=153169,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=5.735152,['Id']=1065,},[2]={['EffectType']=8503,['Y']=27945,['X']=166327,['MetaData']={['message']='There are secrets hidden within the mountain. Look for areas that are lit up by colored lights. There are six: red, orange, yellow, green, blue, and purple.\\n\\nOnce you\\'ve found those six, there is also one unmarked secret area you can try to find. Although this one has no light to guide you to it. Here is your one hint: go to the top of the mountain then think where you havent been yet. This is the biggest secret with lots to see, hope you find it!',['title']='Exploration is key!',},['Color']=102439,['Contrast']=1,['Alpha']=1,['Yaw']=3.490659,['Z']=154053,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=4.799655,['Id']=1066,},[3]={['EffectType']=8503,['Y']=28365,['X']=164265,['MetaData']={['message']='There are secrets hidden within the mountain. Look for areas that are lit up by colored lights. There are six: red, orange, yellow, green, blue, and purple.\\n\\nOnce you\\'ve found those six, there is also one unmarked secret area you can try to find. Although this one has no light to guide you to it. Here is your one hint: go to the top of the mountain then think where you havent been yet. This is the biggest secret with lots to see, hope you find it!',['title']='Exploration is key!',},['Color']=939393,['Contrast']=1,['Alpha']=1,['Yaw']=4.014257,['Z']=158197,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=0.261799,['Id']=1067,},[4]={['EffectType']=8501,['Y']=28184,['X']=159531,['MetaData']={['title']='Ichsuisme\\'s Throne',},['Color']=494949,['Contrast']=1,['Alpha']=1,['Yaw']=2.617994,['Z']=163058,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=0.125664,['Id']=1068,},[5]={['EffectType']=8503,['Y']=27960,['X']=160901,['MetaData']={['title']='Allanas\\'s Throne',},['Color']=373737,['Contrast']=1,['Alpha']=1,['Yaw']=2.551671,['Z']=164061,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=6.276204,['Id']=1069,},[6]={['EffectType']=8503,['Y']=27961,['X']=158587,['MetaData']={['title']='Acunatic\\'s throne',},['Color']=494949,['Contrast']=1,['Alpha']=1,['Yaw']=3.141593,['Z']=162317,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=0,['Id']=1070,},[7]={['EffectType']=8503,['Y']=27957,['X']=158149,['MetaData']={['title']='Simonthesis\\'s Throne',},['Color']=494949,['Contrast']=1,['Alpha']=1,['Yaw']=2.617994,['Z']=162079,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=0,['Id']=1071,},[8]={[