']=1518,},[263]={['EffectType']=8503,['Y']=3584,['X']=55731,['MetaData']={['message']='My dark child, listen to the void that beats within me. It\\'s ceaseless and beautifully rhythmic.\\n\\nBefore you leave, take a part this void that collects within me. Let it grow within you too. Use the blade of woe. Make me proud and cut deep, cut true.\\n\\nCut as much as you need. The void provides. Your family provides.\\n\\nIn the future, whenever you heart pounds, from: rage, from battle, from thrill -- listen to that void, listen to its urges. Become thoughtless. Become senseless. Become empty. Act without fear. Bring change, bring death.\\n\\n/beggar then /say \"CUT\"',['title']='Listen Then Cut',},['Color']=315491,['Contrast']=1.640000,['Alpha']=1,['Yaw']=4.276057,['Z']=30957,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=5.235988,['Id']=1519,},[264]={['EffectType']=5018,['Y']=12899,['X']=58219,['MetaData']={['message']='Are you fearless?',['name']='Motherly Voice',},['Color']=0,['Contrast']=1,['Alpha']=1,['Yaw']=4.712389,['Z']=34227,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1520,},[265]={['EffectType']=5018,['Y']=12884,['X']=58475,['MetaData']={['message']='Will you walk through the void?',['name']='Motherly Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=5.585054,['Z']=33734,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1521,},[266]={['EffectType']=5018,['Y']=12876,['X']=58517,['MetaData']={['message']='Can you reach my void-heart?',['name']='Motherly Voice',},['Color']=696969,['Contrast']=1,['Alpha']=1,['Yaw']=0,['Z']=33101,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1522,},[267]={['EffectType']=411,['Y']=4186,['X']=55286,['Color']=70707,['Contrast']=1,['Alpha']=1,['Pitch']=0,['Z']=31146,['SizeX']=64,['SizeZ']=64,['Groups']=0,['SizeY']=64,['Roll']=0,['Yaw']=4.712389,['Id']=1524,},[268]={['EffectType']=5018,['Y']=4572,['X']=55326,['MetaData']={['message']='Listen. Thump-thump. Thump-thump.',['name']='Motherly Voice',},['Color']=0,['Contrast']=1,['Alpha']=1,['Yaw']=3.141593,['Z']=30991,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1525,},[269]={['EffectType']=5018,['Y']=1781,['X']=55569,['MetaData']={['message']='Did you come to listen or did you come to find my void-heart?',['name']='Night Mother',},['Color']=70707,['Contrast']=1,['Alpha']=1,['Yaw']=3.141593,['Z']=31646,['SizeX']=130,['SizeZ']=300,['Groups']=0,['SizeY']=300,['Roll']=0,['Pitch']=0,['Id']=1526,},[270]={['EffectType']=37,['Y']=2138,['X']=54466,['Color']=0,['Contrast']=3.680000,['Alpha']=1,['Pitch']=0,['Z']=32743,['SizeX']=1000,['SizeZ']=1000,['Groups']=0,['SizeY']=1,['Roll']=0,['Yaw']=2.879793,['Id']=1530,},[271]={['EffectType']=8502,['Y']=12696,['X']=56053,['MetaData']={['message']='Phedre wasn\\'t exactly recommended but she was widely spoken about. I now understand why. We\\'ve been lost this whole time. I asked her to find me a ruin concerning Sithis worship, not a path into Sovengard. It shouldn\\'t have been this hard. How does she call herself an expert?\\n\\nOh. And now that we\\'ve reached the heart of an ancient ruin, Phedre can\\'t wrap her head around the argonian door locks! She\\'s convinced the key to unlocking the door is to use the weight on the eastern side first -- but I am NOT convinced. Have we come all this way just to fail?\\n\\nMy fur weeps for a proper bed, clean clothes, and a bath that doesn\\'t begin and end with cold rain.\\n\\nP.S. There\\'s a spiked terror that roams this chamber. I\\'m afraid of its hidden ferocity so I continue to let it roam -- thought I wish it didn\\'t chew next to my ear or walk over my bed (especially when I\\'m in it).',['title']='Biro-Dar\\'s Complaints',},['Color']=346799,['Contrast']=3.500000,['Alpha']=1,['Yaw']=1.570796,['Z']=36322,['SizeX']=28.456456,['SizeZ']=34,['Groups']=0,['SizeY']=34,['Roll']=0,['Pitch']=4.712564,['Id']=1532,},[272]={['EffectType']=4402,['Y']=12715,['X']=56477,['MetaData']={['message']='Warning: Mature Themes. ',},['Color']=39599,['Contrast']=1,['Alpha']=1,['Yaw']=0.174533,['Z']=36233,['SizeX']=300,['SizeZ']=40,['Groups']=0,['SizeY']=40,['Roll']=0,['Pitch']=0,['Id']=1533,},[273]={['EffectType']=4402,['Y']=12765,['X']=56419,['MetaData']={['message']='Please ask for permission to stream this house!',},['Color']=9899,['Contrast']=1,['Alpha']=1,['Yaw']=0.174533,['Z']=36246,['SizeX']=360,['SizeZ']=60,['Groups']=0,['SizeY']=60,['Roll']=0,['Pitch']=0,['Id']=1535,},[274]={['EffectType']=4402,['Y']=12694,['X']=56538,['MetaData']={['message']='(but artistic)',},['Color']=119199,['Contrast']=1,['Alpha']=1,['Yaw']=0.174533,['Z']=36223,['SizeX']=120,['SizeZ']=20,['Groups']=0,['SizeY']=20,['Roll']=0,['Pitch']=0,['Id']=1536,},[275]={['EffectType']=8503,['Y']=2274,['X']=56795,['MetaData']={['message']='The void hungers for souls. I listened to every name and I had each one silenced. The void always found new names for me to listen to.\\n\\nThe void is glorious.',['title']='Ancient Listener',},['Color']=203743,['Contrast']=1,['Alpha']=1,['Yaw']=4.974188,['Z']=31123,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=5.235988,['Id']=1537,},[276]={['EffectType']=8503,['Y']=2272,['X']=56649,['MetaData']={['message']='The pages of this book are too worn down to understand the original ideas. The only word that is still legible is: Listen.',['title']='Ancient Book',},['Color']=21549,['Contrast']=1,['Alpha']=1,['Yaw']=5.148721,['Z']=30757,['SizeX']=26.456456,['SizeZ']=30,['Groups']=0,['SizeY']=30,['Roll']=0,['Pitch']=5.235988,['Id']=1538,},[277]={['EffectType']=8501,['Y']=2063,['X']=55556,['MetaData']={['message']='You are not a listener yet you listen to your mother. How very wise of you.\\n\\nIf you are truly wise you will take my blade, bring it to my heart and slice a piece of the void off for yourself. It would serve you well; tho